import React, { useState } from 'react';
import { Card, CardHeader, CardContent } from '@/components/ui/card';
import { Button } from '@/components/ui/button';
import { Printer, FileText, CreditCard } from 'lucide-react';

const PrintingInterface = () => {
  const [copies, setCopies] = useState(1);
  const [orientation, setOrientation] = useState('portrait');
  const [selectedPages, setSelectedPages] = useState('all');
  const [totalPages, setTotalPages] = useState(4); // Example total pages
  const [pricePerPage] = useState(15); // Price in Rs.

  const calculateTotal = () => {
    let pageCount;
    switch (selectedPages) {
      case 'all':
        pageCount = totalPages;
        break;
      case 'odd':
        pageCount = Math.ceil(totalPages / 2);
        break;
      case 'even':
        pageCount = Math.floor(totalPages / 2);
        break;
      default:
        pageCount = totalPages;
    }
    return pageCount * copies * pricePerPage;
  };

  return (
    <div className="max-w-4xl mx-auto p-4">
      <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
        {/* Preview Section */}
        <Card className="h-full">
          <CardHeader className="border-b">
            <div className="flex items-center space-x-2">
              <FileText className="w-5 h-5" />
              <h3 className="font-semibold">Document Preview</h3>
            </div>
          </CardHeader>
          <CardContent className="p-4">
            <div className="bg-gray-100 rounded-lg h-96 flex items-center justify-center">
              {/* PDF Preview would go here */}
              <p className="text-gray-500">PDF Preview</p>
            </div>
          </CardContent>
        </Card>

        {/* Print Settings */}
        <Card>
          <CardHeader className="border-b">
            <div className="flex items-center space-x-2">
              <Printer className="w-5 h-5" />
              <h3 className="font-semibold">Print Settings</h3>
            </div>
          </CardHeader>
          <CardContent className="space-y-4 p-4">
            {/* Copies */}
            <div>
              <label className="block text-sm font-medium mb-2">Copies</label>
              <input
                type="number"
                min="1"
                value={copies}
                onChange={(e) => setCopies(parseInt(e.target.value) || 1)}
                className="w-20 p-2 border rounded"
              />
            </div>

            {/* Orientation */}
            <div>
              <label className="block text-sm font-medium mb-2">Layout</label>
              <div className="space-x-4">
                <label className="inline-flex items-center">
                  <input
                    type="radio"
                    checked={orientation === 'portrait'}
                    onChange={() => setOrientation('portrait')}
                    className="mr-2"
                  />
                  Portrait
                </label>
                <label className="inline-flex items-center">
                  <input
                    type="radio"
                    checked={orientation === 'landscape'}
                    onChange={() => setOrientation('landscape')}
                    className="mr-2"
                  />
                  Landscape
                </label>
              </div>
            </div>

            {/* Page Selection */}
            <div>
              <label className="block text-sm font-medium mb-2">Pages</label>
              <div className="space-y-2">
                <label className="block">
                  <input
                    type="radio"
                    checked={selectedPages === 'all'}
                    onChange={() => setSelectedPages('all')}
                    className="mr-2"
                  />
                  All pages
                </label>
                <label className="block">
                  <input
                    type="radio"
                    checked={selectedPages === 'odd'}
                    onChange={() => setSelectedPages('odd')}
                    className="mr-2"
                  />
                  Odd pages only
                </label>
                <label className="block">
                  <input
                    type="radio"
                    checked={selectedPages === 'even'}
                    onChange={() => setSelectedPages('even')}
                    className="mr-2"
                  />
                  Even pages only
                </label>
              </div>
            </div>

            {/* Bill Summary */}
            <Card className="mt-4">
              <CardContent className="p-4">
                <h4 className="font-semibold mb-2">Bill Summary</h4>
                <div className="space-y-2">
                  <div className="flex justify-between">
                    <span>Price per page:</span>
                    <span>₹{pricePerPage}</span>
                  </div>
                  <div className="flex justify-between">
                    <span>Number of pages:</span>
                    <span>{totalPages}</span>
                  </div>
                  <div className="flex justify-between">
                    <span>Number of copies:</span>
                    <span>{copies}</span>
                  </div>
                  <div className="flex justify-between font-semibold border-t pt-2">
                    <span>Total Amount:</span>
                    <span>₹{calculateTotal()}</span>
                  </div>
                </div>
              </CardContent>
            </Card>

            {/* Pay and Print Button */}
            <Button className="w-full mt-4">
              <CreditCard className="w-4 h-4 mr-2" />
              Pay and Print
            </Button>
          </CardContent>
        </Card>
      </div>
    </div>
  );
};

export default PrintingInterface;
